package leetcode.problems.arrays;

import java.util.*;

public class MinimumDeletionsToMakeCharacterFrequenciesUnique {

    public static void main(String[] args) {
        System.out.println(minDeletions(""));
    }

    // my solution maybe not ideal but it works
    //https://leetcode.com/problems/minimum-deletions-to-make-character-frequencies-unique/submissions/?envType=daily-question&envId=2023-09-12
    public static int minDeletions(String s) {
        char[] chars = s.toCharArray();
        Map<Character, Integer> occur = new HashMap();
        for (char ch : chars) {
            occur.put(ch, occur.getOrDefault(ch, 0) +1);
        }

        ArrayList<Integer> values = new ArrayList<>(occur.values());
        Set<Integer> set = new HashSet<>(values);

        if (set.size() == values.size()) {
            return 0;
        } else  {
            Collections.sort(values);

            Integer n = values.get(values.size() - 1);
            Set<Integer> available = new HashSet<>();
            for (int i = 1; i < n; i++) {
                if (!values.contains(i)){
                    available.add(i);
                }
            }

            int minChanges =0;
            for (int i = 1; i < values.size(); i++) {
                Integer val = values.get(i);
                if (Objects.equals(values.get(i - 1), val)) {
                    minChanges += findClosest(available, val);
                }
            }
            return minChanges;
        }
    }

    private static int findClosest(Set<Integer> available, Integer val) {
        int min = val;
        for (int aval :available) {
            if (val > aval) {
                min = Math.min(val - aval, min);
            }
        }

        available.remove(val - min);
        return min;
    }

    // gready algorithm
    // https://leetcode.com/problems/minimum-deletions-to-make-character-frequencies-unique/solutions/1107954/java-simple-solution/
    public int minDeletions_best(String s) {
        int[] charCount = new int[26];

        for(char ch : s.toCharArray()){
            charCount[ ch - 'a'] ++;
        }

        HashSet<Integer> set = new HashSet<>();
        int deletion = 0;

        for(int val : charCount){
            while(val !=0 && set.contains(val)){
                val--;
                deletion++;
            }
            set.add(val);
        }

        return deletion;
    }
}
